import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import Home from "./components/home.js"


const App = props => (
      <Router>
            <Switch>
                  <Route exact path="/" component={Home}/>

            </Switch>
      </Router>
);


export default App;
